import '../index.css'
export default class Square extends Component {
    state={
        value:null
    }
    handleClick=()=>{
        this.setState({
            value:1
        })
    }
    render() {
        return (
            <button className="square" onClick={()=>{
                this.handleClick
            }}>
            </button>
        )
    }
}
